import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and fill search input with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using class selector
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for results to load and take screenshot
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const extractedData = await page.evaluate(() => {
      const products = Array.from(document.querySelectorAll('.product-card'));
      return {
        searchTerm: 'iPhone',
        resultsCount: products.length,
        productTitles: products.map(product => {
          const titleElement = product.querySelector('.product-title');
          return titleElement ? titleElement.textContent : 'No title found';
        }).slice(0, 5) // Get first 5 products
      };
    });

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
